import React from 'react';
import ReactDOM from 'react-dom';
import * as cal from './Heading.jsx';
import contact from './contacts.js'
import './index.css';

function createcards(contact){
  return (
    <cal.Cardz 
      key = {contact.id}
      name = {contact.name}
      tel = {contact.tel}
      email = {contact.email}
    />
  )
}

ReactDOM.render(
  <div>
    {contact.map(createcards)}
  </div>,
  document.getElementById('roots')
);

